import { LEVELS } from './levels.enum';

export class Task {
    name = '';
    description = '';
    completed = false;
    level = LEVELS.NORMAL;
    visibility = 'all'

    constructor(name, description, completed, level) {
        this.name = name;
        this.description = description;
        this.completed = completed;
        this.level = level;
        this.visibility = visibility;
    }
}
